import logo from './logo.svg';
import './App.css';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Hauptseite from './pages/Hauptseite';
import Navbar from './components/navbar';
import Booknow from './components/booknow';
import Footer from './components/footer';
import Slideshow from './slideshow';

function App() {

  const images = [
    {x:<img src="https://sonnenhus.com/sonnenhusgross.jpg" alt="Sonnenhus" />},
    {y:<img src="https://sonnenhus.com/sonnenhusfotos2.jpg" alt="Sonnenhusalt" />}
  ];

  return (
    <div className="App">
      <header>
        <Navbar/>
      </header>
      <div style={{padding:"10px"}}><Slideshow images={images} /></div>
      <div>
        <Hauptseite/>
        <Booknow/>
    </div>
    <footer>
      <Footer/>
    </footer>
    </div>
  );
}

export default App;
